import * as React from 'react';
import { styled } from "@mui/material/styles";
import { 
        DialogContentText, 
        DialogActions, 
        DialogTitle, 
        DialogContent, 
        Dialog, 
        Box, 
        Paper, 
        Grid, 
        Button
    } from "@mui/material";
import NurseSelectDropDown from "./NurseSelectDropDown";
import ShiftSelectDropDown from "./ShiftSelectDropDown";
import ShiftsListControl from './ShiftsListControl';


const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === "dark" ? "#1A2027" : "#fff",
  ...theme.typography.body2,
  padding: theme.spacing(2),
  textAlign: "center",
  color: theme.palette.text.secondary,
}));


export default function ShiftsListingPage() {
 const [open, setOpen] = React.useState(false);
 const [isSaveDisabled, setIsSaveDisabled ] = React.useState(false);
 const [shiftSelected, setShiftSelected] = React.useState(false);
 const [nurseSelected, setNurseSelected] = React.useState(false);

 const handleClickOpen = () => {
   setOpen(true);
 };

const handleClose = () => {
     setOpen(false);
};

const handleSubmit = () => {
};

  return (
    <div>
      <Box sx={{ flexGrow: 1 }}>
        <Grid container direction="column">
          <Grid>
            <Item>
              <Button variant="outlined" onClick={handleClickOpen}>
                Set Shift Assignment
              </Button>
            </Item>
            <Item>
              <ShiftsListControl></ShiftsListControl>
            </Item>
          </Grid>
        </Grid>
      </Box>
      <Dialog fullWidth open={open} onClose={handleClose}>
        <DialogTitle>Set Shift Assignment</DialogTitle>
        <DialogContent>
          <DialogContentText sx={{ padding: "20px" }}>
            Enter the shift assignment details
          </DialogContentText>
          <Box sx={{ padding: "10px" }}>
            <Grid container direction="column" spacing={3}>
              <Grid>
                <Item>
                  <ShiftSelectDropDown></ShiftSelectDropDown>
                </Item>
                <Item>
                  <NurseSelectDropDown></NurseSelectDropDown>
                </Item>
              </Grid>
            </Grid>
          </Box>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose}>
            Cancel
          </Button>
          <Button color="primary" variant="contained" onClick={handleSubmit} disabled={isSaveDisabled}>
            Save Assignment
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}
